exterior.tokenizeString = function(string) {
        var stopWords = ["las", "sra", "urb", "los", "avenida", "frente", "entre", "estado", "edo", "municipio", "mcpio", "con", "sto", "mps", "calle", "principal"];
        return string.split(/[\s\.,;\:\\/\[\]\(\)\{\}]+/).map(function(val) {
            return val.toLowerCase();
        }).filter(function(val) {
            for (w in stopWords) {
                if (stopWords[w] == val) return false;
            }
            return true;
        }).map(function(word) {
            return {t: word, w: 1};
        });
};
